import React from 'react';
import styled from 'styled-components';
import Ptext from './Ptext';

const T1Styles = styled.div`
  overflow-x: hidden;

  text-align: center;
  .testimonal_wrapper {
    position: relative;
    max-width: 1000px;
    margin: 0 auto;
  }
  .testimonal_info {
    width: 100%;
    height: fit-content;
    padding: 3rem;
    background-color: var(--deep-dark);
    border-radius: 12px;
   
  }
  .testimonal_desc {
    .para {
      text-align: center;
      font-weight: 600;
      letter-spacing: 0.2rem;
    }
  }
  .testimonal_name {
    margin-top: 4rem;
    font-family: 'Monteserrat Bold';
    font-size: 2.2rem;
  }
  .testimonal_title {
    font-size: 1.7rem;
    margin-top: 0.3rem;
  }
`;

export default function T1({
  name = 'Abc',
  title = 'CEO',
  org = 'Ekslate',
  desc = 'great',
}) {
  return (
    <T1Styles>
      <div className="testimonal_wrapper">
        <div className="testimonal_info">
          <div className="testimonal_desc">
            <Ptext>{desc}</Ptext>
          </div>
          <h2 className="testimonal_name">{name}</h2>
          <p className="testimonal_org">{org}</p>
          <p className="testimonal_title">{title}</p>
        </div>
      </div>
    </T1Styles>
  );
}
